Need a Father’s Day gift idea? May I suggest ‘A Year of Beer’, an idea courtesy of @haleywynndesigns Thank you Haley for your creative genius!

For Valentine’s Day this year, I found 12 breweries that are local to us, DIY’d a fun ‘coupon’, labeled 12 envelops and filled them with gift cards (or cash) to each brewery. 

Some of the breweries are places we have been before, most are ones we have never visited. Some are family friendly on days the kids tag along, some are not and will be reserved for dedicated date nights. Some are close by, others will require a weekend adventure. You choose!

We now make a conscious effort to pull out the gift cards each month and choose one place to visit. Both of us look forward to this each month and we are really enjoying it! Yay for the gift of experiences! 

If you are local and need some ideas, here are the locations I included.

